package week2;


import java.util.*;

public class SortCharactersByFrequency {

    public static void main(String[] args) {

        System.out.println(frequencySort(""));

    }

    public static String frequencySort(String s) {

        Map<Character, Integer> countMap = new HashMap<>();
        StringBuilder outputString = new StringBuilder();
        Character currentString = '0';

        for(int i = 0; i < s.length(); i++) {
            if(countMap.get(s.charAt(i)) == null) {
                countMap.put(s.charAt(i), 1);
            } else {
                int count = countMap.get(s.charAt(i));
                countMap.put(s.charAt(i), ++count);
            }
        }

        Collection<Integer> frequencies = countMap.values();
        Set<Integer> listFrequencies = new HashSet<>(frequencies);
        List<Integer> listFrequencyInts = new ArrayList<>(listFrequencies);
        Collections.sort(listFrequencyInts, Collections.reverseOrder());

        for(int i = 0; i < listFrequencyInts.size(); i++) {
            for(Map.Entry<Character, Integer> result: countMap.entrySet()) {
                System.out.println(result.getValue());
                System.out.println(listFrequencyInts.get(i));
                if(result.getValue().intValue() == listFrequencyInts.get(i)) {
                    outputString.append(String.join("",Collections.nCopies(result.getValue(),String.valueOf(result.getKey()))));
                    currentString = result.getKey();
                }
            }
            countMap.remove(currentString);
        }

        return outputString.toString();
    }

}
